import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { StreamingTrack, getEnergyLevel, getStreamingCategory } from '../types/track';
import trackStorageService from '../services/trackStorageService';
import SunoPlayer from './SunoPlayer';
import unifiedAudioController from '../services/unifiedAudioController';

const RecentlyGeneratedTracks: React.FC = () => {
  const [recentTracks, setRecentTracks] = useState<StreamingTrack[]>([]);
  const [loading, setLoading] = useState(true);
  const [playingTrackId, setPlayingTrackId] = useState<string | null>(null);

  useEffect(() => {
    loadRecentTracks();

    // Refresh every 30 seconds to catch new tracks
    const interval = setInterval(loadRecentTracks, 30000);
    return () => clearInterval(interval);
  }, []);

  const loadRecentTracks = () => {
    try {
      const tracks = trackStorageService.getRecentlyGeneratedTracks(20);
      setRecentTracks(tracks);
    } catch (error) {
      console.error('Error loading recent tracks:', error);
    } finally {
      setLoading(false);
    }
  };

  const handlePlay = (track: StreamingTrack) => {
    setPlayingTrackId(track.id);
    unifiedAudioController.playTrack(track).catch(console.error);
  };

  const handlePause = () => {
    setPlayingTrackId(null);
    unifiedAudioController.pause();
  };

  const handleEnd = () => {
    setPlayingTrackId(null);
  };

  const handleDelete = (trackId: string) => {
    if (window.confirm('Are you sure you want to delete this track?')) {
      trackStorageService.deleteTrack(trackId);
      loadRecentTracks();
    }
  };

  const handleRename = (track: StreamingTrack) => {
    const newName = prompt('Enter new name for track:', track.title);
    if (newName && newName.trim() !== track.title) {
      const updatedTrack = { ...track, title: newName.trim() };
      trackStorageService.saveTrack(updatedTrack);
      loadRecentTracks();
    }
  };

  if (loading) {
    return (
      <div className="bg-gray-800 rounded-lg p-6">
        <div className="flex items-center justify-center">
          <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-600"></div>
          <span className="ml-3 text-gray-400">Loading recent tracks...</span>
        </div>
      </div>
    );
  }

  if (recentTracks.length === 0) {
    return (
      <div className="bg-gray-800 rounded-lg p-6 text-center">
        <div className="text-gray-400 text-lg mb-2">No tracks generated yet</div>
        <div className="text-gray-500 text-sm">
          Generate your first AI track using the Suno Generator above
        </div>
      </div>
    );
  }

  return (
    <div className="bg-gray-800 rounded-lg p-6">
      <div className="flex items-center justify-between mb-6">
        <h2 className="text-2xl font-bold text-white">Recently Generated</h2>
        <div className="flex items-center space-x-2">
          <button
            onClick={loadRecentTracks}
            className="px-3 py-1 bg-gray-700 hover:bg-gray-600 text-gray-300 rounded text-sm transition-colors"
          >
            🔄 Refresh
          </button>
          <span className="text-gray-400 text-sm">
            {recentTracks.length} tracks
          </span>
        </div>
      </div>

      <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-3">
        <AnimatePresence>
          {recentTracks.map((track, index) => (
            <motion.div
              key={track.id}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              exit={{ opacity: 0, y: -20 }}
              transition={{ delay: index * 0.1 }}
              className="bg-gray-700 rounded-lg p-4 border border-gray-600 hover:border-gray-500 transition-all duration-200"
            >
              {/* Track Header */}
              <div className="flex items-start justify-between mb-3">
                <h3 className="text-lg font-semibold text-white truncate flex-1 mr-2">
                  {track.title}
                </h3>
                <div className="flex items-center space-x-1">
                  <button
                    onClick={() => handleRename(track)}
                    className="p-1 text-gray-400 hover:text-blue-400 transition-colors"
                    title="Rename track"
                  >
                    ✏️
                  </button>
                  <button
                    onClick={() => handleDelete(track.id)}
                    className="p-1 text-gray-400 hover:text-red-400 transition-colors"
                    title="Delete track"
                  >
                    🗑️
                  </button>
                </div>
              </div>

              {/* Track Info */}
              <div className="text-sm text-gray-400 mb-3 space-y-1">
                <div className="flex items-center justify-between">
                  <span>Duration: {track.duration}</span>
                  <span className={`px-2 py-1 rounded text-xs ${
                    getEnergyLevel(track) === 'low' ? 'bg-green-600/20 text-green-400' :
                    getEnergyLevel(track) === 'medium' ? 'bg-yellow-600/20 text-yellow-400' :
                    'bg-red-600/20 text-red-400'
                  }`}>
                    {getEnergyLevel(track).toUpperCase()}
                  </span>
                </div>
                <div className="flex items-center justify-between">
                  <span>{track.genre}</span>
                  <span>{track.mood}</span>
                </div>
              </div>

              {/* Category Badge */}
              <div className="mb-3">
                <span className="px-2 py-1 bg-blue-600/20 text-blue-400 text-xs rounded border border-blue-600/30">
                  {getStreamingCategory(track).replace('_', ' ').replace(/\b\w/g, l => l.toUpperCase())}
                </span>
              </div>

              {/* Suno Player */}
              <SunoPlayer
                track={track}
                isPlaying={playingTrackId === track.id}
                onPlay={() => handlePlay(track)}
                onPause={handlePause}
                onEnd={handleEnd}
                volume={50}
              />

              {/* Generation Info */}
              <div className="mt-3 text-xs text-gray-500 text-center">
                Generated: {track.usageTracking?.lastUsed ? 
                  new Date(track.usageTracking.lastUsed).toLocaleDateString() : 
                  'Unknown'
                }
              </div>
            </motion.div>
          ))}
        </AnimatePresence>
      </div>

      {/* Empty State for No Tracks */}
      {recentTracks.length === 0 && (
        <motion.div
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          className="text-center py-12"
        >
          <div className="text-gray-400 text-lg mb-2">🎵 No tracks generated yet</div>
          <div className="text-gray-500 text-sm">
            Use the Suno Generator above to create your first AI track
          </div>
        </motion.div>
      )}
    </div>
  );
};

export default RecentlyGeneratedTracks;
